            background-color: #4CAF50;
            color: white;
            padding: 10px 20px;
            border: none;
            border-radius: 5px;
            cursor: pointer;
        }
        button[type="submit"]:hover {

        }
        #predictionResult {

<h2>WWQI Prediction</h2>

<form id="wwqiForm">
    <label for="inputYear">Year:</label>
    <input type="number" id="inputYear" name="inputYear" min="2023" max="2034" required><br>
    <label for="inputMonth">Month:</label>
    <input type="number" id="inputMonth" name="inputMonth" min="1" max="12" required><br>
    <label for="inputDay">Day:</label>
    <input type="number" id="inputDay" name="inputDay" min="1" max="31" required><br>
    <button type="submit">Get Prediction</button>
</form>

<div id="predictionResult"></div>

        const predictedWWQI = getPrediction(inputDate);

        const foundData = data.find(item => item.date === date);
        return foundData ? parseFloat(foundData.wwqi) : null;
    }

    function getClassification(predictedValue) {
        if (predictedValue === null) {
            return 'Unknown';
        }
        const conditions = [
            predictedValue < 25,
            predictedValue >= 25 && predictedValue < 50,
            predictedValue >= 50 && predictedValue < 75,
            predictedValue >= 75 && predictedValue < 100,
            predictedValue >= 100
        ];

        const categories = ['Excellent', 'Good', 'Fair', 'Poor', 'Extremely Poor'];

        for (let i = 0; i < conditions.length; i++) {
            if (conditions[i]) {
                return categories[i];
            }
        }

        return 'Unknown';
    }
